import ListComponent from "./ListComponent";

export default class UserLists extends React.Component{
    
    render()
    {
        return (
            <div>
                <ListComponent listName={'My List'}/>
                <ListComponent listName={'My List 2'}/>
            </div>
        );
    }
}
